import {Routes,Route, useNavigate} from "react-router-dom";
import './HomePage.css';


export function  HomePage(){

    const navigate = useNavigate();

    const navigatetoLogin = ()=>{
        //navigate to /login
        navigate('/login');

    }

    return(
        <div>
            <div className='travel'>
                <h2>TravelLog</h2>
                <p>Journey Beyond Boundaries: Connect, Inspire, Explore
                </p>
                <button onClick={navigatetoLogin}> Log In</button>

            </div>
            <div className='second-part'>
                <div><p>Embark on a virtual adventure across the globe through
                    our vibrant and user-friendly travel log app, where you can explore a
                    captivating tapestry of travel experiences shared by fellow adventurers,
                    while adding your own journeys with multiple factors like location details,
                    stunning images, cost of travel, heritage insights, recommended places to visit,
                    community access, transportation ease, and safety ratings, connecting
                    with a passionate community of like-minded explorers, and igniting your wanderlust
                    through inspiring stories, breathtaking visuals,
                    and invaluable tips, all at your fingertips.</p> </div>
                <div> </div>

            </div>

        </div>

    )

}
